import React from "react";
import './Navigation.css';


const Navigation = ({ route }) => {
    if (route === 'register') {
        return (
            <nav >
                <p className="f3 link dim black underline pointer pa3">Register</p>
            </nav>
        );
    }
    else if (route === 'signin') {
        return (
            <nav >
                <p className="f3 link dim black underline pointer pa3">SignIn</p>
            </nav>
        );
    }
    else {
        return (
            <nav >
                <p className="f3 link dim black underline pointer pa3">Sign out</p>
            </nav>
        );
    }
}
export default Navigation;
